function compare(usage, action) {

    // compare start date
    if (action["from"] !== ""){
        if (compare_dates(action["from"], usage["Date of Visit"])){
            return false
        }        
    }
    
    // compare end date
    if (action["to"] !== ""){
        if (compare_dates(usage["Date of Visit"], action["to"])){
            return false
        }        
    }
    
    // compare name
    if (!(usage["Name"].toLowerCase()).startsWith(action["name"].toLowerCase())){
        return false
    }
    
    // compare reference
    if (!usage["Reference"].startsWith(action["reference"])){
        return false
    }
    
    // compare clientype
    if (usage["Client Type"] !== action["clientype"]){
        return false
    }
    
    // compare risk
   if (usage["Risk"] !== action["risk"]){
        return false
    }
    
    return true
}


function compare_dates(date_larger, date_smaller) {
    if (parseInt(date_larger.substring(6, 10) * 1000000 + date_larger.substring(3, 5) * 100 + date_larger.substring(0, 2)) 
        > parseInt(date_smaller.substring(6, 10) * 1000000 + date_smaller.substring(3, 5) * 100 + date_smaller.substring(0, 2))){
        return true
        }
    return false
}


function database_sieve(data_string, instr_string) {
    let constrained_list = [];
    let data = data_string[0]["usages"];
    let instr = instr_string[0]["action"];
    
    for (let usage of data) {
        
        if (compare(usage, instr)) {
            constrained_list.push(usage);
        }
    }
    return constrained_list
}


